import React from 'react';

const Portfolio = (props) => {
    return (
        <>
        <section class="introTitle">
            <div class="introMainTitle">MAIN INFO</div>
            <div class="introSubTitle">PORTFOLIO</div>
        </section>
        <section id="pfSection"></section>
        </>

    );
}

export default Portfolio;
